import React, { Component } from 'react'
import axios from 'axios'
import ReactTable from "react-table"; 
// import 'react-table/react-table.css'

export default function Admin() {
    
    const columns = [{  
        Header: 'Full name',  
        accessor: 'full_name',
       }
       ,{  
        Header: 'Phone',  
        accessor: 'phone' ,
        }
       ,{  
       Header: 'Password',  
       accessor: 'password' ,
       }
    ]


  
    return (
      <ReactTable  columns={columns} />
    );
  }
